import { useCartContext } from "./context/CartContext.jsx";



const Cart = () => {
  const {cart} = useCartContext()
  return (
    <div>
                          <Item
                      name={cart.name}
                      thumbnail={cart.thumbnail}
                      price={cart.price}
                      stock={cart.stock}
                      id={cart.id}
                    />
                  </div>
  )
}
export default Cart
